import './App.css';
import React from 'react';

(function($){

  $.fn.updateImg = function(conf){
      var defConf = {
                      elem_img    : null,
                      url_img     : null,
                    }

      $.extend(defConf, conf);

      if( defConf.elem_img != null && defConf.url_img != null ) {
          $( this ).click(function() {
              $( defConf.elem_img ).attr( "src", defConf.url_img );
          });
      }
  }

})(jQuery);


$(document).ready(function() {
  $("gradient-button").updateImg({ 
      elem_img : "#setImg",
      url_img  : "../public/oldwisetree.jpeg"
  });


});

function App() {
  return (
    <div className="App">

    </div>
  );
}

export default App;
